import React from 'react'
import ProductRow from './ProductTable'

class ProductTable extends React.Component { 
	render() { 
		// Cоздаем переменные rows и lastCategory 
		let rows = []; 

		this.props.products.map((item ,clientsInfo ,index)=>{
					return <ProductRow 
						list={item} 
						key = {clientsInfo} 
						dataCallback={this.hendleDataCallback}/>
		})
		// Добавляем товары в виде компонентов в массив rows  
		return ( 
			<table> 
				<tbody> { rows } </tbody> 
			</table> 
		); 
	} 
}
export default ProductTable
